exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefWrappedRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`http://wap.xiaoshuwu.net/book/${bid}.html`,{cleaner:html=>cleanCatalogWrapper(html,/id="chapterList"/,"</ol>").subIndexOf(">\u6B63\u6587</li>"),recordRegex:hrefWrappedRecordRegex},{clientOptions:{...(options&&options.clientOptions),"x-mobile":1}})};